svg.script:


var tl = gsap.timeline(
    {
        repeat: -1,
        repeatDelay: 3,
        onStart: function(){
            gsap.set("#circle_a", {opacity:0, color:"#C7C9C7" });
            gsap.set("#circle_b", {opacity:0, color:"#C7C9C7" });
        }
    });

var t2 = gsap.timeline(
    {
        repeat: -1,
        repeatDelay: 3,
        onStart: function(){
            gsap.set("#tick_mark_a", {opacity:0});
            gsap.set("#tick_mark_b", {opacity:0});
        }
    });

var t3 = gsap.timeline(
    {
        repeat: -1,
        repeatDelay: 0
    });

tl.add(
        gsap.fromTo(
                    "#circle_a",
                            {
                                opacity:0,
                                color:"#C7C9C7"                                                                   
                            },
                            {
                                opacity:1,
                                color:"#00A6A0",
                                delay: 0,
                                duration: 1.5
                            }
                    )
        );

tl.add(
        gsap.fromTo(
                    "#circle_b",
                            {
                                opacity:0,
                                color:"#C7C9C7"                                                                   
                            },
                            {
                                opacity:1,
                                color:"#00A6A0",
                                delay: 0,
                                duration: 1.5
                            }
                    )
        );

tl.add(
        gsap.fromTo(
                    "#circle_b",
                            {
                                opacity:1,
                                color:"#00A6A0"                                                                   
                            },
                            {
                                opacity:0,
                                color:"#C7C9C7",
                                delay: 1,
                                duration: 1.5
                            }
                    )
        );

tl.add(
        gsap.fromTo(
                    "#circle_a",
                            {
                                opacity:1,
                                color:"#00A6A0"                                                                   
                            },
                            {
                                opacity:0,
                                color:"#C7C9C7",
                                delay: 0,
                                duration: 1.5
                            }
                    )
        );

t2.add(
        gsap.fromTo(
                    "#tick_mark_a",
                            {
                                rotation:-20,
                                opacity: 0,
                                transformOrigin:"center center"
                            },
                            {
                                duration: 1.5,
                                rotation:0,
                                opacity: 1,
                                transformOrigin:"center center",
                                delay: 0,
                                ease:Linear.easeNone                        
                            }
                    )
        );

t2.add(
        gsap.fromTo(
                    "#tick_mark_b",
                            {
                                rotation:-20,
                                opacity: 0,
                                transformOrigin:"center center"
                            },
                            {
                                duration: 1.5,
                                rotation:0,
                                opacity: 1,
                                transformOrigin:"center center",
                                delay: 0,
                                ease:Linear.easeNone                        
                            }
                    )
        );

t2.add(
        gsap.fromTo(
                    "#tick_mark_b",
                            {
                                rotation:0,
                                opacity: 1,
                                transformOrigin:"center center"
                            },
                            {
                                duration: 1.5,
                                rotation:-20,
                                opacity: 0,
                                transformOrigin:"center center",
                                delay: 1,
                                ease:Linear.easeNone                        
                            }
                    )
        );

t2.add(
        gsap.fromTo(
                    "#tick_mark_a",
                            {
                                rotation:0,
                                opacity: 1,
                                transformOrigin:"center center"
                            },
                            {
                                duration: 1.5,
                                rotation:-20,
                                opacity: 0,
                                transformOrigin:"center center",
                                delay: 0,
                                ease:Linear.easeNone                        
                            }
                    )
        );

t3.add(
        gsap.fromTo(
                    "#circle_c",
                            {
                                rotate:0,
                                translateX:0
                            },
                            {
                                rotate:-40,
                                duration:2,
                                translateX:-10,
                                transformOrigin:"center center",
                                ease:Power0.easeNone
                            }
                    )
        );

t3.add(
        gsap.fromTo(
                    "#circle_c",
                            {
                                rotate:-40,
                                translateX:-10
                            },
                            {
                                delay:3,
                                rotate:0,
                                duration:2,
                                translateX:0,
                                transformOrigin:"center center",
                                ease:Power0.easeNone
                            }
                    )
        );
